import React from 'react';

function User({ user }) {
    return (
        <div className="user-container">
            <img src={user.avatar} className="avatar" />
            <div>
                <p>{user.email}</p>
                <p>{user.first_name}</p>
                <p>{user.last_name}</p>
            </div>
            {/* <button onClick={handleToggleEdit}>Edit</button> */}
        </div>
    )
}

export default User;
